import './App.css';
import Layout from './hoc/Layout/Layout';
import { Route, Switch } from 'react-router-dom';
import Produce from './containers/Products/Produce/Produce';
import Frozen from './containers/Products/Frozen/Frozen';
import Deli from './containers/Products/Deli/Deli';
import Bakery from './containers/Products/Bakery/Bakery';
import Home from './containers/Home/Home';

function App() {
  return (
    <div className="App">
      <Layout>
        <Switch>
          <Route path="/" exact component={Home}/>
          <Route path="/Produce" component={Produce}/>
          <Route path="/Frozen" component={Frozen}/>
          <Route path="/Deli" component={Deli}/>
          <Route path="/Bakery" component={Bakery}/>
        </Switch>
      </Layout>
    </div>
  );
}

export default App;
